import React from "react";
import { FaLinkedin, FaGithub } from 'react-icons/fa';
import { AiFillTwitterCircle, AiOutlineInstagram } from 'react-icons/ai';
import pinkBlock from "../images/bg-rec-1.png";
import orangeBlock from "../images/bg-rec-2.png";
import headshot from "../images/headshot.svg";
import logo from "../images/logo.png"

const Nav = () =>{
  return (
    <div className="py-8 max-auto max-w-screen-xl text-center mx-auto bg-gray-100" style={{height: '75vh'}}>
      <div className="w-full h-full box-border">
        <nav className="w-full h-full flex justify-around z-10">
          <div className="flex">
            <FaLinkedin className="mx-4" style={{color: '#EDB462'}} size={25}/>
            <FaGithub className="mx-4" style={{color: '#EDB462'}} size={25}/>
            <AiFillTwitterCircle className="mx-4" style={{color: '#EDB462'}} size={25}/>
            <AiOutlineInstagram className="mx-4" style={{color: '#EDB462'}} size={25}/>
          </div>
          <div className="z-20"><img src={logo} alt="logo" style={{width: '50px'}}/></div>
          <div className="z-20">
            <ul className="flex">
              <li className="mx-4 font-bold">LATEST WORK</li>
              <li className="mx-4 font-bold">BLOG</li>
              <li className="mx-4 font-bold">HIRE ME</li>
            </ul>
          </div>
        </nav>
        <div className="relative z-0">
          Landing
          <img src={headshot} alt="headshot" className="w-1/4" style={{zIndex: '40', position: 'absolute', top: '90px', right: '400px', width: '25%'}}/>
          <img src={pinkBlock} alt="headshot" style={{zIndex: '20', position: 'absolute', bottom: '400px', left: '370px', width: '35%', height: '600px'}}/>
          <img src={orangeBlock} alt="headshot" style={{zIndex: '10', position: 'absolute', bottom: '200px', left: '185px', width: '85%'}}/>
        </div>
      </div>
    </div>
  );
}

export default Nav;
